import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container: {
      marginTop: 5,
      padding: 10,
      flexDirection: 'column',
      alignContent: 'space-between',
      alignItems: 'center',
      justifyContent: 'center',
      backgroundColor: 'white',
    },
    button: {
      color: '#0d84e5d3',
    },
    active: {
      color: 'black'
    }
  })

  export default styles;
